import React from 'react'
// import testChildComponent   from './testChildComponent'

class Login extends React.Component {
  state = {
    email:"",
    password:""
  }

  handlerSubmit =  (e) => {
    console.log(e.target);
  }

  handlerChange = (e) => {
    this.setState({
      [e.target.name]:e.target.value
    })
  }
  render() {
    return (
      <div>
        <h1>Login</h1>
        <form onSubmit={this.handlerSubmit}>
          <label>
            Email:
            <input type="text" name="email" value={this.state.email} onChange={this.handlerChange}/>
            Password:
            <input type="text" name="password" value={this.state.password} onChange={this.handlerChange}/>
          </label>
          <input type="submit" value="Submit" />
        </form>
      </div>
    )
    }
  }

export default Login
